import { NodeWithTypeArguments } from "typescript";
import "./Clock.css";

function Clock(): JSX.Element {

    const [time, setTime] = useState("")

    function showTime (): void {
        const now = new Date();
        time = now.toLocaleTimeString();
        alert (time);
    }
    return (
        <div className="Clock">
			<button onClick={showTime}></button>
        </div>
    );
}

export default Clock;
